INSERT INTO album VALUES ('ALANI01-07-WAN','ALANI01','So Called Chaos','2004-05-18','Seven-time Grammy Award winner Alanis Morissette is back, with the release of \'So-Called Chaos\', her fourth Maverick studio album, on April 13th. \'So-Called Chaos\' is her first album since 2002\'s #2 hit \'Under Rug Swept.');
