INSERT INTO album VALUES ('JOSH_01-02-WAN','JOSH_01','Closer','2003-11-21','One of the biggest-selling male debut artists of 2002, returns with his second studio album, Closer.');
INSERT INTO album VALUES ('LINKI01-06-WAN','LINKI01','Meteora','2003-04-10','Produced by the legendary Don Gilmore, who manned the console for the group\'s four-times-platinum breakthrough, \'Hybrid Theory\'. CD/DVD Limited Edition METEORA features: Same as above 4 panel DVD digipak with an exclusive 30 min &quot;Meteora&quot; episode of LPTV (including never-before-seen footage) and more… For an inside look at the band visit: www.linkinpark.com - Linkin Park TV is a behind-the-scenes look at the band as they write and record their new album, METEORA. Each Tuesday, beginning February 4th, Linkin Park will premiere a new episode of the series. The nine episodes, available only on the LPTV Player and linkinpark.com, lead up to the release of METEORA on March 24th internationally.');
INSERT INTO album VALUES ('THE_C01-11-WAN','THE_C01','Borrowed Heaven','2004-05-31','Four years after their last studio album, The Corrs are back with Borrowed Heaven. A breathtakingly diverse and lyrically sophisticated collection of songs by one of the most successful acts in the world.  ');
INSERT INTO album VALUES ('MICHA01-02-WAN','MICHA01','Come Fly With Me','2004-03-26','The most talked-about concert is now available on DVD! \'Come Fly With Me\' - a wonderful showcase of Michael\'s performances in his first world-tour. Features 63 minutes of concert footages, behind the scenes, interviews and studio recordings PLUS a bonus 8-track CD with two NEW songs!');
INSERT INTO album VALUES ('SAMMI01-09-WAN','SAMMI01','La La La','2004-03-25','Sammi\'s latest Cantonese album [ La La La ] - 16 songs including \'Magical Kitchen\', movie theme song \'Flirting\' (Cantonese version) and \'Nice Relations\' (Mandarin version).');
INSERT INTO artist VALUES ('ALANI01','Alanis','Morissette','When Alanis Morissette first burst upon the global music scene in the mid-Nineties, she created a truly massive commotion. She did so by dramatically reinventing the role of confessional singer-songwriter for a whole new generation of music lovers.','<p>When Alanis Morissette first burst upon the global music scene in the mid-Nineties, she created a truly massive commotion. She did so by dramatically reinventing the role of confessional singer-songwriter for a whole new generation of music lovers. On many levels--sonic, psychic, commercial, and cultural--the impact of Morissette\'s 1995 album JAGGED LITTLE PILL was tremendous.</p><p>\r\n	The album--produced with Morissette\'s collaborator Glen Ballard--sold more than thirty million copies around the world and became one of the most successful recordings in music history. That success quickly transformed Morissette--previously a moderately known singer and actress in her native Canada--into perhaps the most talked-about artist in the world. </p><p>\r\n	With just one album of deeply felt songs intimately chronicling her own often-bumpy ride into adulthood, Morissette became, at age 21, a global superstar and a spokesperson for her generation. </p><p>\r\n	Before long, Morissette also established herself as a live performer of rare intensity, and earned the respect of fans wherever she performed. In 1996, she received Grammys for Album of the Year and Rock Album, as well as Female Rock Vocal Performance and Rock Song of the Year for &quot;You Oughta Know&quot; the explosive song of love and rage that helped kick off the commotion in the first place. </p><p>\r\n	In the years that have followed that initial breakthrough, Morissette has continued to bravely and unflinchingly chronicle her own journey in powerful ways on 1998\'s SUPPOSED FORMER INFATUATION JUNKIE, 1999\'s UNPLUGGED, 2002\'s UNDER RUG SWEPT and that same year\'s CD/DVD offering Feast on Scraps.</p><p>\r\n	Along the way, she\'s also found time to act, on the big screen (a memorable role as God in Kevin Smith\'s film Dogma and the upcoming musical De-Lovely), in acclaimed TV shows (Sex And The City, Curb Your Enthusiasm) and off-Broadway (Vagina Monologues,The Exonerated).</p><p>\r\n	And in recent years, Morissette has also taken on considerable charitable and civic-minded work in her impressive attempt to raise consciousness as well as funds for assorted good causes.</p>');
INSERT INTO artist VALUES ('JOSH_01','Josh','Groban','What most people know about me, they know through my music. This time, I\'ve tried to open that door as wide as possible. These songs are a giant step closer to who I really am and what my music is all about. Hence the title. <br/> \r\n	So says talented vocal phenomenon Josh Groban on the subject of his aptly-titled new Reprise Records release, Closer.','What most people know about me, they know through my music. This time, I\'ve tried to open that door as wide as possible. These songs are a giant step closer to who I really am and what my music is all about. Hence the title.<br/> \r\n	So says talented vocal phenomenon Josh Groban on the subject of his aptly-titled new Reprise Records release, Closer.<br/> \r\n	Featuring the glorious new single, &quot;You Raise Me Up,&quot; Closer is a stunning collection of thirteen diverse and distinctive new tracks, including three original songs by the young artist, that together comprise a musical landscape both richly detailed and sweepingly cinematic; a resonant and revealing self-portrait in sound and a memorable journey through melody and lyric, language and emotion.<br/>\r\n	A self-styled &quot;scribbler&quot; in poetry and lyrics for most of his life, Groban adds, &quot;when I started putting words to music in the studio, it all just seemed to fit.&quot; The results are nothing short of spectacular, thanks in part to the partners he picked. &quot;Walter Afanasieff had been involved on the first album and we had a great working relationship,&quot; explains Josh, of his co-writer on the Closer standout, &quot;Per Te.&quot; &quot;It carried over into songwriting and really gave me the encouragement to push myself. I realized early on the benefit of finding the right creative chemistry, which is why Eric was also such a natural choice.&quot;<br/> \r\n	The Eric in question is Mouquet, one half of the renowned French World Music duo, Deep Forest. &quot;I\'m a huge admirer of what they\'ve done with artists like Peter Gabriel,&quot; Josh enthuses, &quot;and I knew that they would take me in a whole new direction.&quot; Josh, in fact, ended up in Mouquet\'s converted chateau in Northern France for a week-long writing and recording odyssey that yielded two more outstanding Closer selections, &quot;Never Let Go,&quot; with a guest performance from Deep Forest and &quot;Remember When It Rained,&quot; featuring Josh on vocals and, for the first time, on piano.<br/>\r\n	On his new album, Josh Groban has brought us closer to that place.');
INSERT INTO artist VALUES ('LINKI01','Linkin','Park','This Los Angeles, California, USA-based outfit earned the rather dubious distinction of becoming nu metal\'s first pin-ups. Originally known as Xero, the band was formed in 1996 by Mike Shinoda (b. 11 February 1977, USA; MC/vocals), Brad Delson (b. 1 December 1977; guitar), Rob Bourdon (b. 20 January 1979, USA; drums), Phoenix (bass) and DJ Joseph Hahn (b. 15 March 1977, USA). Minus the departing Phoenix, the band was joined by lead singer Chester Bennington (b. 20 March 1976, Phoenix, Arizona, USA) and changed their name to Hybrid Theory, but for legal reasons swiftly adopted the Linkin Park moniker. Their new title arose from a deliberate spelling variation of the Santa Monica landmark, Lincoln Park.','Chester Bennington: Vocals<br/>\r\n	Rob Bourdon: Drums<br/>\r\n	Brad Delson: Guitar<br/>\r\n	Joseph Hahn: Records, sampling<br/>\r\n	Phoenix: Bass<br/>\r\n	Mike Shinoda: Emcee, vocals, sampling, guitar<br/>\r\n	This Los Angeles, California, USA-based outfit earned the rather dubious distinction of becoming nu metal\'s first pin-ups. Originally known as Xero, the band was formed in 1996 by Mike Shinoda (b. 11 February 1977, USA; MC/vocals), Brad Delson (b. 1 December 1977; guitar), Rob Bourdon (b. 20 January 1979, USA; drums), Phoenix (bass) and DJ Joseph Hahn (b. 15 March 1977, USA). Minus the departing Phoenix, the band was joined by lead singer Chester Bennington (b. 20 March 1976, Phoenix, Arizona, USA) and changed their name to Hybrid Theory, but for legal reasons swiftly adopted the Linkin Park moniker. Their new title arose from a deliberate spelling variation of the Santa Monica landmark, Lincoln Park. The band immediately created an impact on the Los Angeles club scene, and was swiftly offered a recording contract with Warner Brothers Records. They subsequently entered the studio with producer Don Gilmore to work on their debut album. [Hybrid Theory] introduces a highly eclectic fusion of metal, hip-hop, industrial and pop styles which is striking even by the standards of pioneers such as Korn and Limp Bizkit. Aided by the heavy radio rotation of &quot;One Step Closer&quot; the album debuted in the US Top 20 in November 2000. By this time, founding member Phoenix had returned to the line-up. The band\'s popularity grew steadily over the next two years, with Hybrid Theory reaching the US Top 5 and the track &quot;In The End&quot; climbing to number 2 on the singles chart. Although not as strong as the debut Meteora made an impressive start with sales of over 1 million upon release in the USA.');
INSERT INTO artist VALUES ('MICHA01','Michael','Buble','This kid can really swing. That, in a nutshell, sums up the extraordinary appeal of a 25 year-old Vancouver vocalist with a gift for making the some of the greatest songs of all time, entirely his own. His name is Michael Buble pronounced Boo-blay) and the evidence of his singular swingingness is on abundant display with his irresistible new Reprise/143 Records debut album.','This kid can really swing.That, in a nutshell, sums up the extraordinary appeal of a 25 year-old Vancouver vocalist with a gift for making the some of the greatest songs of all time, entirely his own. His name is Michael Buble pronounced Boo-blay) and the evidence of his singular swingingness is on abundant display with his irresistible new Reprise/143 Records debut album. More than a tribute to the gold standard of music\'s most enduring songs; more than an homage to a bygone era of songwriting and performing: the thirteen tracks of Michael Buble announce in no uncertain terms the arrival of a major new talent with a flair for infusing familiar and beloved music with a fresh, original and utterly unique sensibility entirely his own. Michael Buble can, indeed, swing.');
INSERT INTO artist VALUES ('SAMMI01','Sammi','Cheng','It all began at the early age of 16, when Sammi Cheng Sau Man took part in and was crowned second runner-up in Hong Kong most prestigious New Talent Singing Contest run by the country largest television station, TVB. Part of the prize was the opportunity for a recording contract and that, duly signed with local independent record company, Capital Artists, was the beginning of bigger things to come! Over the several years of being recognised as one of the leading female singer/performers in Hong Kong and S.E. Asia, Sammi has developed a flair for the dramatic. In fact so much so that she is applauded by fashion critics and the community at large for her intuitive fashion sense and her fabulous use of hair colour and styles to continue to maintain a consistently fresh and unique personal image.','It all began at the early age of 16, when Sammi Cheng Sau Man took part in and was crowned second runner-up in Hong Kong most prestigious New Talent Singing Contest run by the country largest television station, TVB. Part of the prize was the opportunity for a recording contract and that, duly signed with local independent record company, Capital Artists, was the beginning of bigger things to come! Over the several years of being recognised as one of the leading female singer/performers in Hong Kong and S.E. Asia, Sammi has developed a flair for the dramatic. In fact so much so that she is applauded by fashion critics and the community at large for her intuitive fashion sense and her fabulous use of hair colour and styles to continue to maintain a consistently fresh and unique personal image. At an early stage of her recording career, the public attention turned into an opportunity with movies and yet another facet of her career was born. In 1995, Sammi made one of the most important decisions in her career thus far. She signed a new recording contract with Warner Music Hong Kong. Through the support of a major recording company, her recording career and sales of each album, hit the peaks of all time highs and multi-platinum awards and through 6 years with Warner she maintains that position til today. A face that has regular attraction with consumer goods companies, Sammi can be and has been seen gracing the television commercials of companies ranging from Panasonic to Max Factor, the result of clear popularity in endorsement stakes. In addition a further career milestone has been achieved during this time. She held her first solo concert, the ?X Party?concert in 1996 and made that a huge success. Since then every two years a new concert tour occurs beginning in Hong Kong and ending in North America taking in Asia and Australasia along the way. Hong Kong hasn\'t been the only country of success for her, with Mandarin language albums selling huge numbers in Taiwan, Singapore, Malaysia and China. As an example in the year 2000 alone, Warner Music Asia Pacific sold over one million Sammi Cheng albums! The recording part of her career is very, very important, but after having been doormat in movies for approximately four to five years, Sammi came back with a vengeance in the year 2000. She filmed two movies back to back that became the two highest box office grossing movies that year, a take of in excess of sixty million dollars! Nominations followed and she received the nod for a nomination as Best Actress at the prestigious Golden Horse Awards in Taipei. The career continues and the fans and music buying public want more!');
INSERT INTO artist VALUES ('THE_C01','The Corrs','.','Andrea (born on 17/05/74): lead vocals, tin whistle; Caroline (born on 17/03/75): drums, bodhran, vocals ; Sharon (born on 24/03/70): violin, vocals; Jim (born on 31/07/68): keyboards, guitars, vocals.','Andrea (born on 17/05/74): lead vocals, tin whistle; Caroline (born on 17/03/75): drums, bodhran, vocals ; Sharon (born on 24/03/70): violin, vocals; Jim (born on 31/07/68): keyboards, guitars, vocals.<br/>\r\n	When Andrea, Sharon, Caroline and Jim came off the road at the end of 2001,they had spent six years touring and recording almost without a break. Finally, the world’s hardest-working band were able to devote some time to the simple pleasures the rest of us take for granted - home life, relationships, spouses and, in Caroline\'s case, motherhood. &quot;We needed to get our lives back and realise there are more important things than what\'s going to be in the tabloids tomorrow,&quot; as Andrea puts it. <br/>\r\n	The opportunity to take stock and recharge their batteries has paid dividends. Some 18 months in the writing and recording, Borrowed Heaven was recorded in Dublin and Los Angeles, and produced by Olle Romo, a close accomplice of Mutt Lange, who part-produced In Blue, The Corrs\' last studio album.<br/>\r\n	Borrowed Heaven finds the Corrs exploring new avenues both musically and lyrically but retains the feel for melody and the accessible charm that lay at the heart of their original success. &quot;We just went for it and didn\'t give up until every detail was right,&quot; Andrea says, and that attention to detail includes the title, Borrowed Heaven, a key to the album\'s theme: &quot;It\'s the time that we have. The place where we are. Right here and right now – that\'s heaven. All that is light and dark, all that is beautiful and ugly, all pleasure and all pain are transient. We have to live for today.&quot;<br/>\r\n	The Corrs may have sold 30 million records around the globe, but Borrowed Heaven is the sound of a band pushing and striving to top past achievements. This time around, all four contributed to the songwriting. It\'s an approach that has been remarkably successful: &quot;Everybody throws in their ideas and I think that\'s what makes the album sound so different,&quot; says Sharon.');
