INSERT INTO news VALUES (1,'Linkin Park - live in Singapore','LINKIN PARK - Live In Singapore!<br/>\r\n	Date: 22nd June 2004<br/>\r\n	Venue: The Padang<br/>\r\n	Time: 8.00pm<br/> \r\n	Tickets: $150 &amp; $85 (standing)<br>\r\n	SISTIC Hotline: 6348 5555<br/>\r\n	website: www.sistic.com.sg','LINKIN PARK - Live In Singapore!<br/>\r\n	Date: 22nd June 2004<br/>\r\n	Venue: The Padang<br/>\r\n	Time: 8.00pm<br/> \r\n	Tickets: $150 &amp; $85 (standing)<br>\r\n	SISTIC Hotline: 6348 5555<br/>\r\n	website: www.sistic.com.sg','2004-12-30');
INSERT INTO news VALUES (2,'Alanis Morissette Creates \'So-Called Chaos\'','Seven-time Grammy Award winner Alanis Morissette is back, with the release of \'So-Called Chaos\', her fourth Maverick studio album, on April 13th. \'So-Called Chaos\' is her first album since 2002\'s #2 hit \'Under Rug Swept.\'','Seven-time Grammy Award winner Alanis Morissette is back, with the release of \'So-Called Chaos\', her fourth Maverick studio album, on April 13th. \'So-Called Chaos\' is her first album since 2002\'s #2 hit \'Under Rug Swept.\' Produced with John Shanks (Sheryl Crow, Pink) and recorded in a Santa Monica studio owned by Jackson Browne, ‘So-Called Chaos’ is a rumoured return to form for Alanis. <br/>\r\n	Track titles revealed so far include the goth-tinged ‘Eight Easy Steps\', \'The Grudge\', an ode to purging negative thoughts, the sitar-featuring \'Knees Of My Bees\' and \'Everything\', the first single out on February 16th.<br/>\r\n	Aside from writing and recording new material, Alanis recently starred in an off-Broadway production of \'The Exonerated\' and will also feature in an upcoming biopic of Cole Porter, starring Kevin Kline and Ashley Judd.','2004-12-30');
INSERT INTO news VALUES (3,'Josh Performing at the Hollywood Bowl','Music Matters spokesperson Josh Groban will be making his second appearance at the Hollywood Bowl. Conductor John Mauceri and the Hollywood Bowl Orchestra will open the 83rd summer season with the Fifth Annual Hollywood Bowl &quot;Hall of Fame&quot; Ceremony on June 25. Ticketing information to be accounced at a later date.','Music Matters spokesperson Josh Groban will be making his second appearance at the Hollywood Bowl. Conductor John Mauceri and the Hollywood Bowl Orchestra will open the 83rd summer season with the Fifth Annual Hollywood Bowl &quot;Hall of Fame&quot; Ceremony on June 25. Ticketing information to be accounced at a later date.','2004-12-30');
INSERT INTO news VALUES (4,'NEW MICHAEL CD/DVD COMBO IN STORES NOW!','Come Fly With Me is a CD/DVD package available now. The CD features new songs including &quot;Can\'t Help Falling In Love,&quot; &quot;My Funny Valentine,&quot; &quot;Spiderman&quot; and a new mix of &quot;Sway&quot;. The DVD is filled with live performances from around the world, plus interview and backstage footage.','Come Fly With Me is a CD/DVD package available now. The CD features new songs including &quot;Can\'t Help Falling In Love,&quot; &quot;My Funny Valentine,&quot; &quot;Spiderman&quot; and a new mix of &quot;Sway&quot;. The DVD is filled with live performances from around the world, plus interview and backstage footage.','2004-12-30');
INSERT INTO news VALUES (5,'LaLaLa (2nd Version)','Sammi offers you new musical delicacies! After teaming up with F4\'s Jerry Yan and macho star Andy Lau for the movie delight &quot;Magic Kitchen&quot;, the Canto-pop diva blows a winning strike in the music industry again! Her most recent Best of + New Songs treat &quot;Totally Sammi&quot; also helped her score super sales and the top form she offers you on her new Cantonese album via outstanding tunes like &quot;Magic Kitchen\'s&quot; theme song &quot;Flirting&quot; Watch out for this Bossa Nova beat infused track plus all the other amazing treats Sammi\'s &quot;La La La&quot; has in store for you!','Sammi offers you new musical delicacies! After teaming up with F4\'s Jerry Yan and macho star Andy Lau for the movie delight &quot;Magic Kitchen&quot;, the Canto-pop diva blows a winning strike in the music industry again! Her most recent Best of + New Songs treat &quot;Totally Sammi&quot; also helped her score super sales and the top form she offers you on her new Cantonese album via outstanding tunes like &quot;Magic Kitchen\'s&quot; theme song &quot;Flirting&quot; promises to expand her number of fans even further! Watch out for this Bossa Nova beat infused track that was composed by popular musician Chet Lam and written by Wai Man Wong plus all the other amazing treats Sammi\'s &quot;La La La&quot; has in store for you!','2004-12-30');
INSERT INTO news VALUES (6,'Promotional Interviews and Appearances for South East Asia','(2 June) The last little while has seen the band hard at work doing interviews and performances to promote &quot;Borrowed Heaven&quot; in the Far East. As well as an interview and photo shoot for the Japanese edition of Harper\'s Baazar, they helped out with Yahoo Japan\'s environmental campaign \'Green Cross Japan\'. They also did TV interviews for MTV ASIA, Channel V, Indonesia’s RCTI, Myx in the Philippines, Thailand TV, Taiwan TV and Korea’s M-net.','The last little while has seen the band hard at work doing interviews and performances to promote &quot;Borrowed Heaven&quot; in the Far East. As well as an interview and photo shoot for the Japanese edition of Harper\'s Baazar, they helped out with Yahoo Japan\'s environmental campaign \'Green Cross Japan\'. They also did TV interviews for MTV ASIA, Channel V, Indonesia’s RCTI, Myx in the Philippines, Thailand TV, Taiwan TV and Korea’s M-net.<br/>\r\n	If you are in Taiwan you should keep your eyes on the newsstands as the band did press interviews for Liberty Times, United Daily News, Apple Daily, Great Ent. News, Star News and Ming-Sheng Daily. They also did press interviews for Thailand\'s Praew and Thairath, MTV Link in the Philippines, Malaysia\'s Berita Harian and The Star, as well as talking to Indonesia\'s Kompas, Hai and the Femina Group who publish Femina, Gadis, Seventeen and Cita Cinta.<br/>\r\n	On top of all this they even managed to squeeze in some radio interviews for Magic 89.9 in the Philippines, ERA FM in Malaysia and Jakarta’s Prambors.<br/>\r\n	But the most exciting event was the recording of an exclusive performance by the band that will hit the airwaves in Japan and South East Asia soon, so keep an eye on those TV listings.','2004-12-30');
